raw_question: Which address holds the most number of students currently? List the address id and all lines. 
question_index: 561 
join_columns:
 - address_id
 - current_address_id
groupby_columns:
 - address_id
functions:
 - max
 - count
comment: |-
  SELECT T1.address_id,
         T1.line_1,
         T1.line_2
  FROM Addresses AS T1
  JOIN Students AS T2 ON T1.address_id = T2.current_address_id
  GROUP BY T1.address_id
  ORDER BY count(*) DESC
  LIMIT 1

sql: |-
  SELECT T1.address_id,
         T1.line_1,
         T1.line_2
  FROM Addresses AS T1
  JOIN Students AS T2 ON T1.address_id = T2.current_address_id
  GROUP BY T1.address_id
  ORDER BY count(*) DESC
  LIMIT 1
